Aero.Cn.dailR = repmat(0.5 * 0.0574, sizeArray);
Aero.Cn.dailL = -Aero.Cn.dailR;
Aero.Cn.dflapL = -Aero.Cn.dflapR;
Aero.Cn.delev = repmat(0, sizeArray);
Aero.Cn.drud = repmat(-0.1811, sizeArray);

%% Aero Tables
coefList = {'CL', 'CY', 'Cl', 'Cm', 'Cn'};
[Aero] = GenAeroTable(Aero, coefList, Aero.stabFields, Aero.cntrlFields);
[Aero] = GenAeroTable(Aero, {'CD'}, Aero.stabDragFields, Aero.cntrlFields);
end


